B.a9s=new A.c(B.ax,["Perfect scrambled eggs","Learn how to make perfect scrambled eggs with this easy recipe. A quick breakfast packed with protein, courtesy of Bill Granger.",254,18,4,19,15,"Easy","Breakfast",1,1,0,"BBC Good Food","https://images.immediate.co.uk/production/volatile/sites/30/2020/08/recipe-image-legacy-id-1201452_12-7f7a0fa.jpg","https://www.bbcgoodfood.com/recipes/perfect-scrambled-eggs-recipe",B.a5q,"\u0628\u064a\u0636 \u0645\u062e\u0641\u0648\u0642 \u0645\u062b\u0627\u0644\u064a","\u062a\u0639\u0644\u0645 \u0643\u064a\u0641 \u062a\u0635\u0646\u0639 \u0628\u064a\u0636 \u0645\u062e\u0641\u0648\u0642 \u0645\u062b\u0627\u0644\u064a \u0628\u0647\u0630\u0647 \u0627\u0644\u0648\u0635\u0641\u0629 \u0627\u0644\u0633\u0647\u0644\u0629. \u0641\u0637\u0648\u0631 \u0633\u0631\u064a\u0639 \u063a\u0646\u064a \u0628\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646.",B.a6J],t.R)
B.a2U=s(["Heat the grill to high. Arrange the bacon on a baking tray lined with foil. Cook for 5-7 mins until crisp, then turn off the grill but leave the tray inside to keep warm.","In a bowl, mix the flour, baking powder and sugar with a pinch of salt. Make a well in the centre and add the mashed banana, eggs, butter and milk. Whisk to a smooth batter.","Heat a little butter in a large frying pan. Ladle in small dollops of the batter, leaving a little space between each. Put 2 or 3 slices of banana onto each pancake and cook for 2 mins over a medium heat.","When you see bubbles appear, flip the pancakes over and cook for 1 min more, until puffed up and golden.","Serve the pancakes with the crispy bacon and a drizzle of maple syrup."],t.s)
